import './Category.css';
import { Route, Routes, useParams } from "react-router-dom"
import Logo from './Logo';
import { useState } from 'react'
import Search from './Search';
import Session from './Session';
import Products from './Products';
import NotFound from '../NotFound';
import Categories from './Categories';
import Main from './Main';
import RegistrePage from './RegistrePage';


function HomePage({user, setUser}) {
  const [search, setSearch] = useState('')
  const [show, setShow] = useState(false)
  const { category } = useParams()
  return (
    <div className="HomePage">
      <header className="header">
       <Logo />
       <Search setSearch={setSearch} category={category.toLowerCase()}/>
       <Session show={show} setShow={setShow} setUser={setUser}/>
      </header>
      <Routes>
      <Route path="/" element={<Main setUser={setUser} user={user}/>} />
      <Route path="article/:id" element={<RegistrePage />} />
    </Routes>
      <footer className='footer'>+

      </footer>
    </div>
  );
}

export default HomePage;
